import React, { Component } from "react";
import { Button, View, Text, TouchableOpacity, ListView } from "react-native";
import {
  Table,
  TableWrapper,
  Row,
  Rows,
  Col,
  Cols,
  Cell,
} from "react-native-table-component";
//import { DataTable, Cell } from "react-native-data-table";

import courseList from "./data/courses.json";

class Fitnessinfo extends Component {
  constructor(props) {
    super(props);
    this._deleteCourse = this._deleteCourse.bind(this);

    this.state = {
      courseList: courseList,
      HeadTable: ["Name", "Preis", "Beschreibung"],
      courses: [
        ["Salsa", 10, "Tanzen"],
        ["Standard", 9, ("description": "Tanzen")],
        ["Fußball", 5, "Fußball"],
        ["Turnen", 11, "Turnen"],
      ],
    };
  }
  _deleteCourse(index) {
    const { courseList } = this.state;
    this.setState({
      courseList: courseList.filter((fitness) => fitness.id !== id),
    });
    console.log("Deleted");
    return;
  }
  _getSingleObject(index, fitness) {
    index === 1
      ? fitness.name
      : index === 2
      ? fitness.price
      : index === 3
      ? fitness.description
      : Row;
  }
  render() {
    const state = this.state;
    const courseList = this.state.courseList.map((fitness) => [
      fitness.name,
      fitness.price,
      fitness.description,
    ]);

    const element = (data, index) => (
      <TouchableOpacity onPress={() => this._deleteCourse(index)}>
        <View>
          <Text>button</Text>
        </View>
      </TouchableOpacity>
    );
    return (
      <View>
        <Table borderStyle={{ borderWidth: 1, borderColor: "#000000" }}>
          <Row data={state.HeadTable} onPress={() => console.log("Heyho!")} />
          {state.courses.map((rowData, index) => (
            <TableWrapper key={index}>
              {rowData.map((cellData, cellIndex) => (
                <Cell
                  key={cellIndex}
                  data={cellIndex === 3 ? element(cellData, index) : cellData}
                />
              ))}
            </TableWrapper>
          ))}
        </Table>
      </View>
    );
  }
}

export default Fitnessinfo;

